import React from 'react';
import { Component } from 'react';
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';
import { ToastContainer } from 'react-toastify';


class ThematicList extends Component {

    componentWillMount() {
    }

    componentDidUpdate() {
    }

